import React from 'react';
import { motion } from 'framer-motion';
import '../styles/AnimatedBackground.css';

const AnimatedBackground = ({ colors }) => {
  // Use default colors if none provided or if colors array is too small
  const backgroundColors = colors && colors.length >= 5 
    ? colors 
    : ['#355c7d', '#6c5b7b', '#c06c84', '#f67280', '#f8b195', '#3f51b5', '#7e57c2', '#4caf50']; // Fallback to a nice gradient palette with 8 colors

  return (
    <div className="animated-background">
      {/* Extra large background blobs - reduced to 2 */}
      {[...Array(2)].map((_, i) => (
        <motion.div
          key={`xlarge-circle-${i}`}
          className="gradient-circle xlarge-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[i % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${10 + (i * 40)}%`, 
            left: `${5 + (i * 45)}%`, 
            willChange: "transform",
            transform: "translateZ(0)"
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1,
          }}
          animate={{
            // Simplified animation with fewer keyframes
            x: [0, 120, -120, 0], 
            y: [0, -90, 90, 0],   
            scale: [1, 1.2, 0.9, 1], 
          }}
          transition={{
            duration: 25,              
            ease: "easeInOut",         
            repeat: Infinity,
            repeatType: "mirror",      
            times: [0, 0.33, 0.67, 1] 
          }}
        />
      ))}

      {/* Large primary blobs - reduced to 3 */}
      {[...Array(3)].map((_, i) => (
        <motion.div
          key={`circle-${i}`}
          className="gradient-circle large-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 3) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${-10 + (i * 40)}%`,
            left: `${-20 + (i * 45)}%`,
            willChange: "transform",
            transform: "translateZ(0)"
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1,
          }}
          animate={{
            // Simplified animation
            x: [0, 150, -150, 0], 
            y: [0, -100, 100, 0],   
            scale: [1, 1.15, 0.95, 1], 
          }}
          transition={{
            duration: 20,             
            ease: "easeInOut",         
            repeat: Infinity,
            repeatType: "mirror",      
            times: [0, 0.33, 0.67, 1],
            delay: i * 2 // Increased delay for less simultaneous animation
          }}
        />
      ))}

      {/* Medium sized blobs - reduced to 3 */}
      {[...Array(3)].map((_, i) => (
        <motion.div
          key={`medium-circle-${i}`}
          className="gradient-circle medium-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 2) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${20 + (i * 30)}%`,
            left: `${70 - (i * 35)}%`,
            willChange: "transform",
            transform: "translateZ(0)"
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1
          }}
          animate={{
            // Simplified animation
            x: [0, -110, 110, 0],       
            y: [0, 70, -70, 0],        
            scale: [0.9, 1.15, 0.85, 0.9], 
          }}
          transition={{
            duration: 18,              
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.33, 0.67, 1],
            delay: i * 3 // More delay for staggered effect
          }}
        />
      ))}

      {/* Small faster moving accent blobs - reduced to 3 */}
      {[...Array(3)].map((_, i) => (
        <motion.div
          key={`small-circle-${i}`}
          className="gradient-circle small-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 1) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${60 - (i * 25)}%`,
            left: `${20 + (i * 30)}%`,
            willChange: "transform",
            transform: "translateZ(0)"
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1
          }}
          animate={{
            // Simplified animation
            x: [0, 80, -80, 0], 
            y: [0, -60, 60, 0], 
            scale: [1, 1.1, 0.9, 1], 
          }}
          transition={{
            duration: 15,              
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.33, 0.67, 1],
            delay: i * 1.5
          }}
        />
      ))}

      {/* Small rapid-moving blobs - reduced to 2 */}
      {[...Array(2)].map((_, i) => (
        <motion.div
          key={`tiny-circle-${i}`}
          className="gradient-circle tiny-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 5) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${40 + (i * 20)}%`,
            left: `${50 - (i * 20)}%`,
            willChange: "transform",
            transform: "translateZ(0)"
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1
          }}
          animate={{
            // Simplified animation
            x: [0, 60, -60, 0],
            y: [0, -50, 50, 0],
            scale: [0.95, 1.05, 0.9, 0.95],
          }}
          transition={{
            duration: 12,
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.33, 0.67, 1],
            delay: i * 1
          }}
        />
      ))}

      {/* Very subtle overlay for contrast */}
      <div className="background-overlay" />
    </div>
  );
};

export default React.memo(AnimatedBackground); // Memoize to prevent unnecessary re-renders
